    "recovery-of-queen-conch-in-the-u-s-virgin-islands",nt"isopen": false,nt"url":
    null,nt"notes": "The queen conch is an important cultural component and an
    extremely valuable coral reef fishery resource throughout the Caribbean, historically
    second only to the spiny lobster.  Comparisons of past studies with current densities
    from these areas continue to show that queen conch populations are depleted although
    we may be seeing small signs of increase.  This data set investigates the population
    status of queen conch around St. John, U.S. Virgin Islands, through mark and recapture,
    habitat availability and utilization, acoustic tracking, and seasonal migration
    studies to provide needed information for improved management.",nt"license_title":
